import React from 'react';
import './stats-table.scss'
class statsTable extends React.Component{
    constructor(){
        super();
        this.state={
            sortedby : ''
        }
    }

    render(){


        return(
            <table>
                <tr>
                    <td className="index">&nbsp;&nbsp;</td>
                    <td className="tableh">Country</td>
                    <td className="tableh">Corona 	<br></br> Cases</td>
                    <td className="tableh">Deaths</td>
                    <td className="tableh">Recovered</td>
                </tr>
                
                    {this.props.data.slice(0 , 10).map((country, index) =><tr>
                        <td>{index}</td>
                        <td>{country.Country}</td>
                        <td>{country.TotalConfirmed}</td>
                        <td>{country.TotalDeaths}</td>
                        <td>{country.TotalRecovered}</td>
                    </tr>)}
                
            </table>
        )
    }  
}

export default statsTable;
